import HungerGames from "./images/BooksImg/TheHungerGames.jpg";
import WorldWar from "./images/BooksImg/WorldWarZ.jpg";
import DieHard from "./images/BooksImg/DieHard.jpg";
import PlayerOne from "./images/BooksImg/TheReadyPlayerOne.jpg";
import { ScrollingCarousel } from "@trendyol-js/react-carousel";

export default class Books extends Component {



  render() {
  let Images = [{
    id: 1, title: "Atomic Habits", ImgSource: {AtomicHabit},
  }]
    return (
      <div className="container">
        <div className="row">
          <div className="col">
            <h3 className="mx-1 fs-4" style={{fontFamily: "sans-serif"}}>Top Books</h3>
            <ScrollingCarousel className="m-1">
              <div>
              <img
                src={AtomicHabit}
                style={{ height: "300px", width: "200px" }}
                className="img-fluid rounded mx-2"
                alt="..."
              />
                <p>Atomic habits</p>
              </div>
              <img
                src={HungerGames}
                style={{ height: "300px", width: "200px" }}
                className="img-fluid rounded mx-2"
                alt="..."
              />
              <img
                src={WorldWar}
                style={{ height: "300px", width: "200px" }}
                className="img-fluid rounded mx-2"
                alt="..."
              />
              <img
                src={DieHard}
                style={{ height: "300px", width: "200px" }}
                className="img-fluid rounded mx-2"
                alt="..."
              />
              <img
                src={PlayerOne}
                style={{ height: "300px", width: "200px" }}
                className="img-fluid rounded mx-2"
                alt="..."
              />
            </ScrollingCarousel>
          </div>
        </div>
      </div>
    );
  }
}
